pragma solidity ^0.8.4;

import "./YunToken.sol";
import "./Safemath.sol";

contract YunTokenSale {
    using SafeMath for uint256;

    address admin;
    YunToken public tokenContract;
    uint256 public  tokenPrice;
    uint256 public tokensSold;

    constructor(YunToken _tokenContract, uint256 _tokenPrice) {
        //Set admin
        admin = msg.sender;
        tokenContract = _tokenContract;
        tokenPrice = _tokenPrice;
        tokenContract.transfer(admin, tokenContract.balanceOf(address(this)));
    }

    event Sell(address _buyer, uint256 _amount);
    event Info(uint256 _value);


    function buyTokens(uint256 _numberOfTokens) public payable {
        //Require that value is equal to tokens
        require(msg.value == _numberOfTokens.mul(tokenPrice));

        //Require that the contract has enough tokens
        require(tokenContract.balanceOf(address(this)) >= _numberOfTokens);

        //Send tokens
        require(tokenContract.transfer(msg.sender, _numberOfTokens));

        //Require that a transfer is successful
        tokensSold += _numberOfTokens;

        //Keep track of tokensSold

        //Trigger Sell event
        emit Sell(msg.sender, _numberOfTokens);

    }

    function endSale() public payable {
        //Require admin
        require(msg.sender == admin);

        //Transfer remaining yun tokens to admin
        require(tokenContract.transfer(admin, tokenContract.balanceOf(address(this))));

        payable(admin).transfer(address(this).balance);

    }
}
